import { View, StyleSheet, Text } from "react-native";
import React from "react";

import TopBar from "./TopBar";

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: "center",
        justifyContent: "center",
    },
    courseName: {
        fontFamily: "Iceland",
        fontSize: 40,
        fontStyle: "italic",
        textDecorationLine: "underline",
    },
    courseDesc: {
        fontFamily: "Arial",
        fontSize: 15,
    },
    fadeFromLeft: {
        //flexDirection: "row",
    },
    fadeFromRight: {
    }

})

function Courses() {
    return(
        <View styles={styles.container}>
            <TopBar></TopBar>
            <View style={{padding: 35}}></View>
                <View style={styles.fadeFromLeft}>
                    <Text style={styles.courseName}>CSE 115</Text>
                    <Text style={styles.courseDesc}>In this course</Text>
                </View>
        </View>
    )
}

export default Courses;
